For the full Arnotts website experience, to be able to purchase online and to make full use of personalised features, your computer or mobile phone will need to accept cookies. We use the information from cookies to improve your customer experience and offer you products we think you will like.
Our cookies don’t store sensitive information such as your name, address or payment details but they allow us to access this information once you have signed in to your account. If you’d prefer to restrict or delete cookies from Arnotts website, you can use your browser to do this. Simply check the ‘Help’ menu of your particular browser to learn how to change your cookie preferences.
We offer an extensive range of beauty, accessories and fashion brands to buy online. We use the information that you provide to:

Administer our website services including reporting;
Offer you a more personalised online experience;
Inform you of products and services relevant to your needs;
Let you track items that you purchase online using our secure order tracking service;
Credit, debit or other payment card verification and screening;
Safety, security, health, training, administrative and legal purposes;
Data matching and dedupe, statistical and market analysis, and marketing information;
Advertising and marketing for us, our Group and third parties;
Studies, research and development;
Customer surveys;
Customer care;
Where required by law or in connection with legal proceeding or disputes;
Any other uses set out in the terms and conditions for use of our services. For these purposes we may disclose your information to one or more of the other organisations listed in the section called “who we will share your personal information with”.

Registration: This allows you to become a member of the Arnotts Wonder Loyalty scheme. Points earned under the scheme may be redeemed against purchases anytime. As a member, you will be the first to hear about our in-store promotions. The information that you provide will allow Arnotts to tailor personal invitations to events, previews and fashion shows.
Our website offers the facility for you to express your preferences about how you like to reconceive marketing communications from us. You can specify the kind of content that you prefer and how often you would like to receive that content. Arnotts will make every effort to fulfil your preferences. However, there may be occasions when we may deem it necessary to send you communications that we feel may be of interest to you but which fall outside your indicated preferences or frequency of contact. You agree that you do not object to us contacting you for purposes other than those indicated in your expressed preferences and at a frequency that may differ from your expressed preference.
Tracking: We collect, and use third parties to collect and share with us, information from lots of visitors to our website. We analyse this non personal information to build up a picture of how people use our website. This helps us improve the services we offer. We may also give anonymous statistics about visitors to other, reputable organisations, but the information we provide will not include details that would allow these organisations to identify you.
Advert targeting: We may use the information you give us about yourself and the information we collect via cookies when you use our online services to build up a picture of your interests. We may then use this information to try to make sure that when we send you marketing communications and when you visit our websites or use our online services, you don't miss offers and information that might interest you. This information may also be used by our third party advertising agencies and networks, to advertise our products and services to you when you visit third party websites and online services. This is called advert targeting or interest-based advertising. For more information on how to reject targeted advertising or interest-based advertising cookies please read our cookie policy.
Social networks: If you follow us or interact with us on any of our pages on third party social media platforms, such as Instagram, Facebook, Twitter, Pinterest or Google+, the information that you provide will be subject to the third party’s privacy policy, as well as this privacy policy.
Competitions: When entering any of our contests or prize draws, you provide your name, email address and mailing address. If you win, we will send the prize to the address entered and notify you by email or a phone call. The winner of the competition consents to the use of their first name and region for publication by Arnotts and its related companies, for an unlimited time. Publications include any medium (internet, print, social media, websites hosted by Arnotts and its related companies ). In entering a competition, all entrants consent to same.
Customer surveys: Every now and again, we may ask you for your opinion on our services and the products you have purchased through our services. When we do research or surveys, we may use cookies and may combine the information collected by those cookies with your answers. To thank you for sharing your experiences of shopping with us, we may hold a competition draw for small prize. If you win, we will send the prize to your registered address entered and notify you by mail. The winner of the competition consents to the use of their first name and region for publication by Arnotts and its related companies, for an unlimited time. Publications include any medium (internet, print, social media, websites hosted by Arnotts and its related companies). In entering a competition or a survey, all entrants consent to same.
You agree that you do not object to us contacting you for any of the above purposes whether by telephone, e-mail or in writing and you confirm that you do not and will not consider any of the above as being a breach of any of your rights under the Privacy and Electronic Communications (EC Directive) Regulations 2003.
